import React from 'react'
import { MDPlace } from 'react/icons/md';
import PText from './PText';

import './contactinfoitemleft.css';

export default function ContactInfoItemLeft({
    icon = <MDPlace />,
    text = 'this is an info'
}) {
  return (
    <div>
        <div className="icon">{icon}</div>
        <div className="info">
            <PText>{text}</PText>
        </div>
    </div>
  )
}
